import{_ as e,c as i,o as a,N as o}from"./chunks/framework.6abe1570.js";const v=JSON.parse('{"title":"UAParser.js Changelog","description":"","frontmatter":{},"headers":[],"relativePath":"intro/whats-new.md","lastUpdated":1698751202000}'),r={name:"intro/whats-new.md"},l=o('<h1 id="uaparser-js-changelog" tabindex="-1">UAParser.js Changelog <a class="header-anchor" href="#uaparser-js-changelog" aria-label="Permalink to &quot;UAParser.js Changelog&quot;">​</a></h1><h2 id="version-2-0" tabindex="-1">Version 2.0 <a class="header-anchor" href="#version-2-0" aria-label="Permalink to &quot;Version 2.0&quot;">​</a></h2><ul><li>What&#39;s breaking: <ul><li>Dual-licensed under AGPLv3 or PRO License</li><li>Browser detection on mobile device: <ul><li><code>&quot;Chrome&quot;</code> on mobile device =&gt; <code>&quot;Mobile Chrome&quot;</code></li><li><code>&quot;Firefox&quot;</code> on mobile device =&gt; <code>&quot;Mobile Firefox&quot;</code></li></ul></li><li>OS detection: <ul><li><code>&quot;Mac OS&quot;</code> =&gt; <code>&quot;macOS&quot;</code></li><li><code>&quot;Chromium OS&quot;</code> =&gt; <code>&quot;Chrome OS&quot;</code></li></ul></li></ul></li><li>What&#39;s new: <ul><li>Some new methods in result object: <ul><li>Support for client hints: <a href="/v2/api/ua-parser-js/idata/with-client-hints.html"><code>withClientHints()</code></a></li><li>Support for feature detection: <a href="/v2/api/ua-parser-js/idata/with-feature-check.html"><code>withFeatureCheck()</code></a></li><li>Utility for easy comparison: <a href="/v2/api/ua-parser-js/idata/is.html"><code>is()</code></a></li><li>Utility to print full-name: <a href="/v2/api/ua-parser-js/idata/to-string.html"><code>toString()</code></a></li></ul></li><li>Support for ES module <a href="/v2/intro/quick-start/using-es-modules.html"><code>import { UAParser } from &#39;ua-parser-js&#39;</code></a></li><li>Provide Enums submodule <a href="/v2/api/submodules/enums.html"><code>&#39;ua-parser-js/enums&#39;</code></a></li><li>Provide Extensions submodule <a href="/v2/api/submodules/extensions/overview.html"><code>&#39;ua-parser-js/extensions&#39;</code></a></li><li>Provide Helpers submodule <a href="/v2/api/submodules/helpers/overview.html"><code>&#39;ua-parser-js/helpers&#39;</code></a></li></ul></li></ul><h3 id="version-2-0-0-alpha-2" tabindex="-1">Version 2.0.0-alpha.2 <a class="header-anchor" href="#version-2-0-0-alpha-2" aria-label="Permalink to &quot;Version 2.0.0-alpha.2&quot;">​</a></h3><ul><li>Fix browser result always returning Chromium when using <code>withClientHints()</code></li><li>Fix infinite-loop when await-ing <code>withClientHints()</code> in non-client-hints browser</li></ul><h3 id="version-2-0-0-alpha-1" tabindex="-1">Version 2.0.0-alpha.1 <a class="header-anchor" href="#version-2-0-0-alpha-1" aria-label="Permalink to &quot;Version 2.0.0-alpha.1&quot;">​</a></h3><ul><li>Initial work on new major version</li></ul><h2 id="version-0-7-1-0" tabindex="-1">Version 0.7 / 1.0 <a class="header-anchor" href="#version-0-7-1-0" aria-label="Permalink to &quot;Version 0.7 / 1.0&quot;">​</a></h2><p>Version 1.0.x is basically the equivalent of version 0.7.x. See <a href="https://github.com/faisalman/ua-parser-js/issues/536" target="_blank" rel="noreferrer">#536</a> for the reason behind this confusion.</p><h3 id="version-0-7-35-1-0-35" tabindex="-1">Version 0.7.35 / 1.0.35 <a class="header-anchor" href="#version-0-7-35-1-0-35" aria-label="Permalink to &quot;Version 0.7.35 / 1.0.35&quot;">​</a></h3><ul><li>Fix result from user-supplied user-agent being altered</li><li>Add new browser: Heytap, TikTok</li><li>Add new engine: LibWeb</li><li>Add new OS: SerenityOS</li><li>Improve browser detection: Yandex</li><li>Improve device detection: iPhone, Amazon Echo</li><li>Improve OS detection: iOS</li></ul><h3 id="version-0-7-34-1-0-34" tabindex="-1">Version 0.7.34 / 1.0.34 <a class="header-anchor" href="#version-0-7-34-1-0-34" aria-label="Permalink to &quot;Version 0.7.34 / 1.0.34&quot;">​</a></h3><ul><li>Fix Sharp Mobile detected as Huawei Tablet</li><li>Fix IE8 bug</li><li>Add new devices : Kobo e-Reader, Apple Watch, and some new SmartTV devices</li><li>Add new OS : watchOS</li><li>Improve browser detection : Kakao, Naver, Brave</li><li>Improve device detection : Oculus, iPad</li><li>Improve OS detection : Chrome OS</li><li>Using navigator.userAgentData as fallback for device.type &amp; os.name</li></ul><h3 id="version-0-7-33-1-0-33" tabindex="-1">Version 0.7.33 / 1.0.33 <a class="header-anchor" href="#version-0-7-33-1-0-33" aria-label="Permalink to &quot;Version 0.7.33 / 1.0.33&quot;">​</a></h3><ul><li>Add new browser : Cobalt</li><li>Identify Macintosh as an Apple device</li><li>Fix ReDoS vulnerability</li></ul><h3 id="version-0-7-32-1-0-32" tabindex="-1">Version 0.7.32 / 1.0.32 <a class="header-anchor" href="#version-0-7-32-1-0-32" aria-label="Permalink to &quot;Version 0.7.32 / 1.0.32&quot;">​</a></h3><ul><li>Add new browser : DuckDuckGo, Huawei Browser, LinkedIn</li><li>Add new OS : HarmonyOS</li><li>Add some Huawei models</li><li>Add Sharp Aquos TV</li><li>Improve detection Xiaomi Mi CC9</li><li>Fix Sony Xperia 1 III misidentified as Acer tablet</li><li>Fix Detect Sony BRAVIA as SmartTV</li><li>Fix Detect Xiaomi Mi TV as SmartTV</li><li>Fix Detect Galaxy Tab S8 as tablet</li><li>Fix WeGame mistakenly identified as WeChat</li><li>Fix included commas in Safari / Mobile Safari version</li><li>Increase UA_MAX_LENGTH to 350</li></ul><h3 id="version-0-7-31-1-0-2" tabindex="-1">Version 0.7.31 / 1.0.2 <a class="header-anchor" href="#version-0-7-31-1-0-2" aria-label="Permalink to &quot;Version 0.7.31 / 1.0.2&quot;">​</a></h3><ul><li>Fix OPPO Reno A5 incorrect detection</li><li>Fix TypeError Bug</li><li>Use AST to extract regexes and verify them with safe-regex</li></ul><h3 id="version-0-7-30-1-0-1" tabindex="-1">Version 0.7.30 / 1.0.1 <a class="header-anchor" href="#version-0-7-30-1-0-1" aria-label="Permalink to &quot;Version 0.7.30 / 1.0.1&quot;">​</a></h3><ul><li>Add new browser : Obigo, UP.Browser, Klar</li><li>Add new device : Oculus, Roku</li><li>Add new OS: Maemo, HP-UX, Android-x86, Deepin, elementary OS, GhostBSD, Linspire, Manjaro, Sabayon</li><li>Improve detection for Sony Xperia 1ii, LG Android TV, and some more devices</li><li>Improve detection for ARM64 CPU</li><li>Improve detection for Windows Mobile, Netscape, Mac on PowerPC</li><li>Categorize PDA as mobile</li><li>Fix Sharp devices misjudged as Huawei</li><li>Fix trailing comma for ES3 compatibility</li><li>Some code refactor</li></ul><h2 id="version-0-8" tabindex="-1">Version 0.8 <a class="header-anchor" href="#version-0-8" aria-label="Permalink to &quot;Version 0.8&quot;">​</a></h2><p>Version 0.8 was created by accident. This version is now deprecated and no longer maintained, please update to version 0.7 / 1.0.</p>',23),t=[l];function n(s,d,c,u,h,m){return a(),i("div",null,t)}const b=e(r,[["render",n]]);export{v as __pageData,b as default};
